    "2016-03-17T20:51:56.269823",nt"name": "monthly-medicaid-payments-recipients-by-county",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains aggregate Medicaid
    payments, and counts for eligible recipients and recipients served by month and
    county, starting with month ending 1/31/2011.rnrnEligibility groups are a category
    of people who meet certain common eligibility requirements. Some Medicaid eligibility
    groups cover additional services, such as nursing facility care and care received
    in the home. Others have higher income and resource limits, charge a premium, only
    pay the Medicare premium or cover only expenses also paid by Medicare, or require
    the recipient to pay a specific dollar amount of their medical expenses. Eligible
    Medicaid recipients may be considered medically needy if their medical costs are
    so high that they use up most of their income. Those considered medically needy
    are responsible for paying some of their medical expenses. This is called meeting
    a spend down. Then Medicaid would start to pay for the rest. Think of the spend
    down like a deductible that people pay as part of a private insurance plan.",nt"license_title":
